from Scraping_shoops.Classes.store import BaseStore, Soupclass FoxtrotStore(BaseStore):    __name__ = 'Foxtrot.ua'    def __init__(self,):        self.soup = Soup(FoxtrotStore.get(self, shop_url='https://www.foxtrot.com.ua/uk/shop'                                                         '/graficheskie_plansheti_wacom.html'))        super().__init__(            shop_url='https://www.foxtrot.com.ua/uk/shop/graficheskie_plansheti_wacom.html',            all_items=self.soup.find_element(class_='listing__body-wrap image-switch')        )